ImportContract.sol.content:
// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.0;
import {HashFunction} from "./HashFunction.sol";
contract A {

   HashFunction hash = new HashFunction();

   function importDemo(string memory _text, uint _num, address _address) external view returns (bytes32){
        return hash.hash1(_text, _num, _address);
   }
}

